  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/home" element={<Home />} />
        <Route path="/why-carbon" element={<WhyCarbon />} />

      </Routes>
    </Router>
  );
}

export default App;
